import './Navigation.css'

const Navigation = () => {
  return (
  <div class='navigation'>
        <div class='navLeft'><h1 class='title'>josh</h1></div>
        <div class='navRight'>
            <ul class='navigation-links'>
                <li>work</li>
                <li>about</li>

            </ul>
        </div>
  </div>
  );
};

export default Navigation;
